import React from 'react';
// import './App.css';

class CoutriesLibrary extends React.Component {

  render() {

    const { contrie } = this.props
    console.log(contrie)

    return (
      <div>
        <img  src={ contrie.flag } alt={ contrie.name } />
        <div>
          <h4>{ contrie.name}</h4>
          <p>{ `Capital: ${contrie.population}` }</p>
          <p>{ `Capital: ${contrie.ragion}` }</p>
          <p>{ `Capital: ${contrie.capital}` }</p>
        </div>  
    </div>

    );
  }


}

export default CoutriesLibrary;
